});

    const containerStyle = {
        padding: "100px",
        margin: "100px",
        border: '1px solid black',
        borderRadius:"500px"
    }

    const btnStyle = {
        padding: "20px",
    }

    return (
        <div className="Container" style={containerStyle}>
        </div>
    )
}

export default Clock;
